import logo from '../logo.png';
import '../App.css';
import $ from 'jquery';
import React, { Component } from 'react';

class Main extends Component {
    render() {
        return (
            <div className="App">
                <header className="App-header">
                <button className="clicker">
                    <img src={logo} className="App-logo" alt="logo" />
                </button>
                <a href="/wizard">Wizard</a>
                </header>
            </div>
        );
    }
}

export default Main;
